import { withStyles } from "@material-ui/core/styles";

export default withStyles(theme => {
  const { colors } = theme.palette;

  return {
    container: {
      width: "75%",
      height: "75%"
    },
    socialLinkContainer: {
      position: "absolute",
      bottom: 0,
      left: 40
    },
    number: {
      color: colors.secondary
    },
    pageTitle: {
      color: colors.white,
      marginLeft: 10
    },
    form: {
      display: "flex",
      justifyContent: "center",
      flexDirection: "column",
      width: "65%",
      margin: "auto"
    },
    inputContainer1: {
      display: "flex",
      justifyContent: "flex-start"
    },
    inputContainer2: {
      display: "flex",
      justifyContent: "flex-end"
    },
    input: {
      width: "90%"
    },
    textarea: {
      height: "100px"
    }
  };
});
